import React from 'react'
import img from "./../images/telepherique.jpg"
import CardPlace from './CardPlace'

function PopularPlace() {
  return (
    <div id='PopularPlace'>
      <h1>
        Hôtel
      </h1>
        <section>
        <CardPlace 
        img={img}
        lieu={"Ankorondrano"}
